import React from 'react' ;
import { useState } from 'react';
import useStyles from './Request-jss';


const InputElement = () => {

  const classes = useStyles()

  const [category , setCategory] = useState({ category : null})


  console.log(category.category)

  
  let element = null ;

  const changeCategory = (event) =>{ setCategory({category : event.target.value});
                if (category.category === 'Social aides')     {
                  element = 
                      <div className='text-center'>   
                          <div className='form-group'>
                                  <select
                                    id='type'
                                    name='type'
                                    
                                    className='custom-select input-select input-text' >
                                      <option value='0'>All types</option>
                                      <>
                                        <option key='1' value='1'>Social </option>
                                        <option key='2' value='2'>Medical </option>
                                        <option key='3' value='3'>Solidarity </option>
                                        <option key='4' value='4'>Other </option>
                                      </>
                                  </select>
                          </div>
                      </div> ;
                   
          
                }
              }


  
    return (
    <div className={`${classes.page} text-center`}>   
        <div className='form-group'>
                <select
                  id='category'
                  name='category'
                  onChange={changeCategory}
                  className='custom-select input-select input-text' >
                    <option value='0'>All categories</option>
                    <>
                      <option key='1' value='1'>Social aides</option>
                      <option key='2' value='2'>Medical services</option>
                      <option key='3' value='3'>Solidarity services</option>
                      <option key='4' value='4'>Other services</option>
                    </>
                </select>
        </div>

        {element }

    </div> 
    )
}

export default InputElement ;
